  render(){
    return (
      <form className="forml">
        <div className="texttospeech-box">
          <div className="card-header">
          <h3>Generate text to speech</h3>
        </div>
        {/* <label className="story">Generate Text to Speech:</label> */}
        <div className="card-body">
        <textarea id="story" name="story" rows="9" cols="40" maxLength="500" style="height: 320px;"> Type Here..</textarea>
        </div>
         
        </div>
        <div className="card-footer">
          <span className="font-weight-bold" id="wordcount">500 characters</span>
        </div>
        </form>

        
      
    )
  }
}
